INSERT INTO `products_description` (`products_id`, `language_id`, `products_name`, `products_short`, `products_description`, `products_cp_ce_menosnombre_1`, `products_cp_ce_menosnombre_2`, `products_cp_ce_menosnombre_3`, `products_add_1`, `products_url`, `products_viewed`) VALUES
(7, 1, 'PERRO BAÃ‘O MEDIANO', '', '', '', '', '', '', NULL, 0),
(13, 1, 'OPTIMA NOVA PUPPY MEDIUM CARNE DE POLLO PERRO 2KG', '', '<div>\r\n	PUPPY MEDIUM</div>\r\n<div>\r\n	CHICKEN &amp; RICE</div>\r\n<div>\r\n	ALIMENTO SUPER PREMIUM PARA CACHORROS DE RAZAS MEDIANAS (A PARTIR DE 2 MESES DE VIDA)</div>\r\n<div>\r\n	Optimanova Puppy Medium Chicken &amp; Rice contiene una equilibrada mezcla de prote&iacute;nas biol&oacute;gicas que favorecen un correcto desarrollo y mantenimiento del sistema muscular. Sus croquetas han sido especialmente desarrolladas para su estatura y complexi&oacute;n. Adem&aacute;s su exquisito sabor y el aporte id&oacute;neo de carne fresca, dan como resultado una receta saludable y deliciosa.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(8, 109, 177); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n		<span style=\"font-size: 14px;\">65% CARNE DE POLLO</span></h3>\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(69, 69, 69); font-family: dinmedium; font-size: 14px;\">\r\n		&nbsp;</p>\r\n	<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n		<li style=\"box-sizing: border-box;\">\r\n			Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Carne fresca de pollo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Una sola fuente de prote&iacute;na animal.</li>\r\n	</ul>\r\n</div>\r\n<div>\r\n	IMMUNITY CONTROL PROGRAM</div>\r\n<div>\r\n	Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al desarrollo del sistema nervioso, fortaleciendo el sistema inmune y la salud cardiovascular.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	DIGESTIVE HEALTH SYSTEM</div>\r\n<div>\r\n	El efecto prebi&oacute;tico del FOS, estimula la flora bacteriana beneficiosa del sistema digestivo (efecto b&iacute;fidus). Los MOS eliminan la flora perjudicial, logrando una mejor salud digestiva.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	NATURAL DEFENSE SYSTEM</div>\r\n<div>\r\n	El aporte extra de Zinc, Vitamina A y biotina contribuyen al buen funcionamiento del sistema inmunol&oacute;gico, manteniendo la salud del pelo, la piel y las mucosas pulmonares e intestinales.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	MINERALS OPTIMAL BALANCE</div>\r\n<div>\r\n	El equilibrio de minerales y vitaminas (calcio/f&oacute;sforo/ Vit. D) consiguen el m&aacute;ximo crecimiento del cachorro y un &oacute;ptimo desarrollo &oacute;seo y muscular.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	NEUROLOGICAL DEVELOPMENT</div>\r\n<div>\r\n	Los &aacute;cidos grasos esenciales presentes en el arroz y aceite de pescado, estimulan la funci&oacute;n cerebral y previenen el desgaste y la degeneraci&oacute;n del sistema nervioso.</div>\r\n<div>\r\n	<img class=\"tabla\" src=\"https://www.optimanova.eu/assets/content/tables/33973-tablas-gato-esp_0012_puppy-medium.png\" style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: center; box-sizing: border-box; border: 0px; vertical-align: middle; margin-top: 30px; margin-bottom: 30px; padding: 30px; box-shadow: rgba(50, 50, 50, 0.68) -10px 8px 30px 0px;\" /></div>\r\n<div>\r\n	&nbsp;</div>', '', '', '', '', '', 76),
(12, 1, 'OPTIMA NOVA PUPPY MINI CARNE DE POLLO PERRO 2KG', '', '<p>\r\n	PUPPY MINI<br />\r\n	CHICKEN &amp; RICE</p>\r\n<p>\r\n	<br />\r\n	ALIMENTO SUPER PREMIUM PARA CACHORROS DE RAZAS MINIS Y/O PEQUE&Ntilde;AS (A PARTIR DE 2 MESES DE VIDA)<br />\r\n	Los perros peque&ntilde;os tienen una fase de crecimiento corta pero muy intensa. Por eso Optimanova Puppy Mini Chicken &amp; Rice, est&aacute; especialmente formulado para cubrir sus necesidades nutricionales y fortalecer su sistema inmunitario, estimulando la producci&oacute;n de anticuerpos. El tama&ntilde;o de las croquetas, especial para mand&iacute;bulas</p>\r\n<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(8, 109, 177); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n	<span style=\"font-size:14px;\">65% CARNE DE POLLO</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(69, 69, 69); font-family: dinmedium; font-size: 14px;\">\r\n	&nbsp;</p>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<li style=\"box-sizing: border-box;\">\r\n		Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n	<li style=\"box-sizing: border-box;\">\r\n		Carne fresca de pollo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n	<li style=\"box-sizing: border-box;\">\r\n		Una sola fuente de prote&iacute;na animal.</li>\r\n</ul>\r\n<div>\r\n	IMMUNITY CONTROL PROGRAM</div>\r\n<div>\r\n	Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al desarrollo del sistema nervioso, fortaleciendo el sistema inmune y la salud cardiovascular.</div>\r\n<div>