(14, 1, 'OPTIMA NOVA ADULT MINI POLLO PERRO 2KG', '', '<p>\r\n	ADULT MINI<br />\r\n	&nbsp;CHICKEN &amp; RICE</p>\r\n<p>\r\n	&nbsp;ALIMENTO SUPER PREMIUM PARA PERROS ADULTOS DE RAZAS PEQUE&Ntilde;AS (A PARTIR DE LOS 10 MESES DE VIDA)<br />\r\n	&nbsp;A partir de los 10 meses de vida, tu perro de raza peque&ntilde;a alcanza la madurez y necesita una dieta equilibrada para esta nueva etapa. Optimanova Adult Mini Chicken &amp; Rice le ayudar&aacute; a mantener su peso ideal, gracias a un &oacute;ptimo aporte de calor&iacute;as y prote&iacute;nas especialmente adaptado a sus caracter&iacute;sticas. Contiene vitaminas y amino&aacute;cidos que protegen su piel y refuerzan el sistema inmunol&oacute;gico. Su f&oacute;rmula especial de alta palatabilidad y sus croquetas con estructura especial para mand&iacute;bulas peque&ntilde;as, dan como resultado una receta ideal para los paladares m&aacute;s exigentes.</p>\r\n<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(145, 18, 123); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n	<span style=\"font-size:14px;\">65<span style=\"box-sizing: border-box; position: relative; line-height: 0; vertical-align: baseline; top: -0.5em;\">%</span>&nbsp;CARNE DE POLLO</span></h3>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<li style=\"box-sizing: border-box;\">\r\n		Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n	<li style=\"box-sizing: border-box;\">\r\n		Carne fresca de pollo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n	<li style=\"box-sizing: border-box;\">\r\n		Una sola fuente de prote&iacute;na animal.</li>\r\n</ul>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	IMMUNITY CONTROL PROGRAM</div>\r\n<div>\r\n	Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al desarrollo del sistema nervioso, fortaleciendo el sistema inmune y la salud cardiovascular.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	DIGESTIVE HEALTH SYSTEM</div>\r\n<div>\r\n	El efecto prebi&oacute;tico del FOS, estimula la flora bacteriana beneficiosa del sistema digestivo (efecto b&iacute;fidus). Los MOS eliminan la flora perjudicial, logrando una mejor salud digestiva.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	SKIN &amp; COAT</div>\r\n<div>\r\n	La presencia del Zinc ayuda a la regeneraci&oacute;n de la piel, manteni&eacute;ndola en un estado sano y vigoroso. Los &aacute;cidos grasos la fortalecen y consiguen un pelo fuerte y brillante.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	HIGH DIGESTIBILITY</div>\r\n<div>\r\n	La elevada digestibilidad de los nutrientes permiten la m&aacute;xima absorci&oacute;n de &eacute;stos, aprovechando al m&aacute;ximo sus elementos nutritivos y estimulando la salud intestinal.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	HIGH PALATABILITY</div>\r\n<div>\r\n	La elevada calidad y frescura de los ingredientes, junto a una excelente combinaci&oacute;n de aceites y carne de pollo, consiguen una m&aacute;xima apetencia estimulando el consumo del alimento.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<p>\r\n	<img src=\"https://www.optimanova.eu/assets/content/tables/50eac-tablas-gato-esp_0013_adult-mini.png\" /></p>', '', '', '', '', '', 66),
(20, 1, 'OPTIMA NOVA ADULT MINI CONEJO PERRO 2KG', '', '<div>\r\n	ADULT MINI</div>\r\n<div>\r\n	RABBIT AND POTATO</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	ALIMENTO SUPER PREMIUM SIN CEREALES PARA PERROS ADULTOS DE RAZAS PEQUE&Ntilde;AS. IDEAL PARA PERROS CON DIGESTI&Oacute;N DELICADA</div>\r\n<div>\r\n	Adult Mini Digestive Rabbit &amp; Potato es el &uacute;nico producto del mercado en su categor&iacute;a que est&aacute; hecho a base de carne de conejo fresco. F&aacute;cil de digerir, sabroso y bajo en calor&iacute;as, colesterol y grasas, tambi&eacute;n contiene importantes minerales como hierro, magnesio y zinc., El Omega3 ayudar&aacute; a manetener su p</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(152, 143, 25); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n		<span style=\"font-size:14px;\">70<span style=\"box-sizing: border-box; position: relative; line-height: 0; vertical-align: baseline; top: -0.5em;\">%</span>&nbsp;CARNE&nbsp;DE&nbsp;CONEJO</span></h3>\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(69, 69, 69); font-family: dinmedium; font-size: 14px;\">\r\n		&nbsp;</p>\r\n	<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n		<li style=\"box-sizing: border-box;\">\r\n			Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Carne fresca de conejo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Una sola fuente de prote&iacute;na animal.</li>\r\n	</ul>\r\n</div>\r\n<div>\r\n	IMMUNITY CONTROL PROGRAM</div>\r\n<div>\r\n	Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al desarrollo del sistema nervioso, fortaleciendo el sistema inmune y la salud cardiovascular.</div>\r\n<div>\r\n	HIGH DIGESTIBILITY</div>\r\n<div>\r\n	La elevada digestibilidad de los nutrientes permiten la m&aacute;xima absorci&oacute;n de &eacute;stos, aprovechando al m&aacute;ximo sus elementos nutritivos y estimulando la salud intestinal.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	ORALCARE</div>\r\n<div>\r\n	La configuraci&oacute;n de fibra diet&eacute;tica combinada con minerales (calcio/f&oacute;sforo) producen un &ldquo;efecto de cepillado&rdquo; en los dientes. Se reduce la formaci&oacute;n de sarro y de la placa bacteriana que produce el mal aliento.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	GASTRIC PROTECTION</div>\r\n<div>\r\n	La mezcla especial de los ingredientes provocan una digesti&oacute;n r&aacute;pida con el m&iacute;nimo desgaste en el est&oacute;mago.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	PREBIOTIC EFFECT</div>\r\n<div>\r\n	La inclusi&oacute;n de elementos con acci&oacute;n prebi&oacute;tica (FOS-MOS, almid&oacute;n resistente) estimula la proliferaci&oacute;n de bacterias digestivas que mejoran la salud intestinal (efecto b&iacute;fidus).</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<img class=\"tabla\" src=\"https://www.optimanova.eu/assets/content/tables/a7114-50eac-tablas-gato-esp_0013_adult-mini.png\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; margin-top: 30px; margin-bottom: 30px; padding: 30px; box-shadow: rgba(50, 50, 50, 0.68) -10px 8px 30px 0px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-align: center;\" /></div>', '', '', '', '', '', 62),
(17, 1, 'OPTIMA NOVA ADULT SENSITIVE SALMON Y PAVO PERRO 2KG', '', '<div>\r\n	ADULT SENSITIVE</div>\r\n<div>\r\n	SALMON &amp; POTATO</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	ALIMENTO SUPER PREMIUM SIN CEREALES PARA PERROS ADULTOS CON PIELES SENSIBLES Y/O EST&Oacute;MAGOS DELICADOS</div>\r\n<div>\r\n	La receta de Optimanova Adult Sensitive Salmon &amp; Potato es perfecta para cualquier raza, especialmente para aquellas con digestiones sensibles o que requieran un mayor cuidado en la piel y el pelo. El salm&oacute;n, como &uacute;nica fuente de prote&iacute;na, lo proteger&aacute; de posibles alergias e intolerancias alimentarias. La combinaci&oacute;n del zinc, vitamina A, biotina y &aacute;cidos grasos Omega-3 y Omega-6 favorecer&aacute;n la belleza y la salud de su piel, pelo y mucosas. Adem&aacute;s el jengibre estimular&aacute; la producci&oacute;n de enzimas digestivas facilitando la absorci&oacute;n de los nutrientes.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(223, 108, 14); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n		<span style=\"font-size:14px;\">70% SALM&Oacute;N</span></h3>\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(69, 69, 69); font-family: dinmedium; font-size: 14px;\">\r\n		&nbsp;</p>\r\n	<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n		<li style=\"box-sizing: border-box;\">\r\n			Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Salm&oacute;n de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Una sola fuente de prote&iacute;na animal.</li>\r\n	</ul>\r\n	<div>\r\n		IMMUNITY CONTROL PROGRAM</div>\r\n	<div>\r\n		Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al desarrollo del sistema nervioso, fortaleciendo el sistema inmune y la salud cardiovascular.</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		DIGESTIVE HEALTH SYSTEM</div>\r\n	<div>\r\n		El efecto prebi&oacute;tico del FOS, estimula la flora bacteriana beneficiosa del sistema digestivo (efecto b&iacute;fidus). Los MOS eliminan la flora perjudicial, logrando una mejor salud digestiva.</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		GASTRIC PROTECTION</div>\r\n	<div>\r\n		La mezcla especial de los ingredientes provocan una digesti&oacute;n r&aacute;pida con el m&iacute;nimo desgaste en el est&oacute;mago.</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		SKIN &amp; COAT</div>\r\n	<div>\r\n		La presencia del Zinc ayuda a la regeneraci&oacute;n de la piel, manteni&eacute;ndola en un estado sano y vigoroso. Los &aacute;cidos grasos la fortalecen y consiguen un pelo fuerte y brillante.</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		INTESTINAL PROTECTION</div>\r\n	<div>\r\n		La acci&oacute;n protectora de la L-glutamina sobre las c&eacute;lulas de la mucosa intestinal, unida a la acci&oacute;n estimulante de la producci&oacute;n de enzimas digestivas del jengibre facilitan de una manera extraordinaria la digesti&oacute;n de los nutrientes.</div>\r\n	<div>\r\n		<img src=\"https://www.optimanova.eu/assets/content/tables/03591-tablas-gato-esp_0004_adult-sensitive.png\" /></div>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '', '', '', 54),
(21, 1, 'OPTIMA NOVA ESTERILIAZADO GATO 2KG', '', '<div>\r\n	CAT STERILISED</div>\r\n<div>\r\n	CHICKEN &amp; RICE</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	ALIMENTO COMPLETO PARA GATOS ADULTOS A PARTIR DE LOS 12 MESES DE EDAD, FORMULADO PARA EL MANTENIMIENTO DE LA VITALIDAD Y CONTROL DE PESO EN LOS GATOS TRAS SU ESTERILIZACI&Oacute;N.</div>\r\n<div>\r\n	Los gatos esterilizados aumentan su apetito considerablemente, en cambio su actividad disminuye debido a que baja su producci&oacute;n de hormonas. Por eso necesitan una alimentaci&oacute;n como Optimanova Cat Sterilised Chicken and Rice, que les aporta la cantidad justa de calor&iacute;as para afrontar su actividad diaria sin sobrepasarla para ayudarles a mantener su peso.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(0, 155, 149); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n		<span style=\"font-size:14px;\">75% CARNE DE POLLO</span></h3>\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(69, 69, 69); font-family: dinmedium; font-size: 14px;\">\r\n		&nbsp;</p>\r\n	<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n		<li style=\"box-sizing: border-box;\">\r\n			Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Carne fresca de pollo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C.</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Una sola fuente de prote&iacute;na animal.</li>\r\n	</ul>\r\n	<div>\r\n		Omega 3 &amp; Omega 6</div>\r\n	<div>\r\n		Protege al si