(22, 1, 'OPTIMA NOVA PUPPY MEDIUM CARNE DE POLLO PERRO 12KG', '', '<div>\r\n	PUPPY MEDIUM</div>\r\n<div>\r\n	CHICKEN &amp; RICE</div>\r\n<div>\r\n	ALIMENTO SUPER PREMIUM PARA CACHORROS DE RAZAS MEDIANAS (A PARTIR DE 2 MESES DE VIDA)</div>\r\n<div>\r\n	Optimanova Puppy Medium Chicken &amp; Rice contiene una equilibrada mezcla de prote&iacute;nas biol&oacute;gicas que favorecen un correcto desarrollo y mantenimiento del sistema muscular. Sus croquetas han sido especialmente desarrolladas para su estatura y complexi&oacute;n. Adem&aacute;s su exquisito sabor y el aporte id&oacute;neo de carne fresca, dan como resultado una receta saludable y deliciosa.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<h3 style=\"box-sizing: border-box; font-family: gothic20; font-weight: 500; line-height: 1.1; color: rgb(8, 109, 177); margin-top: 0px; margin-bottom: 10px; font-size: 70px;\">\r\n		<span style=\"font-size: 14px;\">65% CARNE DE POLLO</span></h3>\r\n	<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(69, 69, 69); font-family: dinmedium; font-size: 14px;\">\r\n		&nbsp;</p>\r\n	<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n		<li style=\"box-sizing: border-box;\">\r\n			Elaboraci&oacute;n propia a partir de ingredientes 100% naturales de proveedores locales homologados con los que llevamos trabajando m&aacute;s de 20 a&ntilde;os.</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Carne fresca de pollo de la m&aacute;s alta calidad, sin conservantes, colorantes, ni aromatizantes artificiales. Contiene antioxidantes naturales (tocoferoles) y vitaminas A, E y C. SIN GLUTEN</li>\r\n		<li style=\"box-sizing: border-box;\">\r\n			Una sola fuente de prote&iacute;na animal.</li>\r\n	</ul>\r\n</div>\r\n<div>\r\n	IMMUNITY CONTROL PROGRAM</div>\r\n<div>\r\n	Sistema de protecci&oacute;n anti-cancer&iacute;gena, contribuye al de