(24, 1, 'OPTIMA NOVA ADULT MEDIUM POLLO Y ARROZ PERRO 12KG', '', '<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">ADULT MEDIUM - CHICKEN &amp; RICE</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	A partir de los 12 meses de vida, tu perro de raza mediana alcanza la madurez y necesita una dieta equilibrada que le ayude en esta nueva etapa. Optimanova Adult Medium Chicken &amp; Rice le ayuda a mantener un peso ideal liberando la energ&iacute;a de forma controlada. Refuerza sus defensas, protege su piel y pelo e incluye antioxidantes naturales (tocoferoles).</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-heigh