&nbsp;</span>Vitamina A 18.000 UI/Kg. Vitamina D3 1.800 UI/Kg. Vitamina E 250 mg/Kg. Vitamina C 100 mg/Kg. Biotina 3,4 mg/Kg. Hierro (sulfato ferroso monohidrata- do) 68 mg/Kg. Yodo (yoduro pot&aacute;sico) 3,2 mg/Kg. Cobre (Sulfato c&uacute;prico pentahidratado) 9 mg/Kg. Manganeso (sulfato manganoso monohidratado) 6,8 mg/Kg. Zinc (&oacute;xido de zinc) 135 mg/Kg. Selenio (selenito s&oacute;dico) 0,1 mg/Kg. L-carnitina 70 mg/Kg. Taurina 30 mg/Kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">TECNOL&Oacute;GICO:&nbsp;</span>Extractos naturales ricos en tocoferoles.</p>', '', '', '', '', '', 11),
(25, 1, 'OPTIMA NOVA ADULT LARGE POLLO Y PATATA PERRO 12KG', '', '<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">ADULT LARGE - CHICKEN &amp; POTATO</span></p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	Gracias al aporte de glucosamina y condroitina, Optimanova Adult Large Chicken &amp; Potato est&aacute; especialmente formulado para prevenir los da&ntilde;os prematuros en huesos y articulaciones que suelen padecer las razas grandes. El &oacute;ptimo contenido en EPA Y DHA favorece el proceso de digesti&oacute;n y fortalece el sistema inmune, adem&aacute;s gracias a la inclusi&oacute;n de pulpa de remolacha, mejorar&aacute; la consistencia de las deposiciones.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">COMPOSICI&Oacute;N:</span>&nbsp;Pollo fresco (40%), Carne deshidratada de pollo (25%), Patata (15%), Acei- tes y grasas, Guisantes, Hidrolizado de h&iacute;gado de pollo (5%), Prote&iacute;na de patata, Levaduras, Pulpa de remolacha, Cloruro s&oacute;dico, Cloruro pot&aacute;sico, Inulina (500 mg/kg - FOS), Glucosa- mina (350 mg/kg), Manano-oligosac&aacute;ridos (130 mg/kg), Condroitina (70 mg/kg), Yucca schidigera.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">CONSTITUYENTES ANAL&Iacute;TICOS:&nbsp;</span>Prote&iacute;na bruta 25,00%, Aceites y grasas brutos 16,00%, &Aacute;cidos grasos omega 3: 0,40%, &Aacute;cidos grasos omega 6: 3,60 %, EPA + DHA 920 mg/kg, Fibras brutas 3,25%, Ceniza bruta 8,00%, Calcio 1,35 %, F&oacute;sforo 1,05%.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">ADITIVOS:&nbsp;</span>Vitamina A 18.000 UI/kg. Vitamina D3 1.800 UI/kg. Vitami- na E 250 mg/kg. Vitamina C 100 mg/kg. Hierro (sulfato ferroso monohidratado) 68 mg/kg. Yodo (Yoduro pot&aacute;sico) 3,2 mg/kg. Cobre (Sulfato c&uacute;prico pentahidratado) 9 mg/kg. Manganeso (sulfato manganoso monohidratado) 6,8 mg/kg. Zinc (oxido de zinc) 135 mg/kg. Selenio (selenito s&oacute;dico) 0,1 mg/kg. Taurina 270 mg/kg. L- carnitina 70 mg/kg.</p>\r\n<p style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px 0px 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: Gotham, sans-serif; vertical-align: baseline; color: rgb(85, 87, 91);\">\r\n	<span style=\"box-sizing: border-box; outline: none; box-shadow: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-transform: uppercase;\">TECNOL&Oacute;GICO:&nbsp;</span>Antioxidantes: Extractos naturales ricos en tocoferoles.</p>', '', '', '', '', '', 11);
